import React, { useEffect, useState } from 'react';
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Typography,
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Checkbox,
  ListItemText,
} from '@mui/material';

const AssignPathologiesDialog = ({ open, onClose, patient, onAssign }) => {
  const [pathologies, setPathologies] = useState([]);
  const [selectedPathologies, setSelectedPathologies] = useState([]);
  const [assignedPathologies, setAssignedPathologies] = useState([]);

  useEffect(() => {
    const fetchPathologies = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/pathologies', {
          method: 'GET',
          credentials: 'include',
        });
        const data = await response.json();
        setPathologies(data);
      } catch (error) {
        console.error('Error fetching pathologies:', error);
      }
    };

    fetchPathologies();
    fetchAssignedPathologies();
  }, [patient.uuid]);

  const fetchAssignedPathologies = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/patient_pathology/${patient.uuid}`, {
        method: 'GET',
        credentials: 'include',
      });
      const data = await response.json();
      setAssignedPathologies(data);
    } catch (error) {
      console.error('Error fetching assigned pathologies:', error);
    }
  };

  const handleAssign = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/patient_pathology', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({ patient_uuid: patient.uuid, pathology_ids: selectedPathologies }),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      fetchAssignedPathologies(); // Refresh assigned pathologies after assignment
      onAssign();
      onClose();
    } catch (error) {
      console.error('Error assigning pathologies:', error);
    }
  };

  const handleUnassign = async (pathologyId) => {
    try {
      const response = await fetch('http://localhost:5000/api/patient_pathology', {
        method: 'DELETE',
        headers: {
          'Content-Type': 'application/json',
        },
        credentials: 'include',
        body: JSON.stringify({ patient_uuid: patient.uuid, pathology_id: pathologyId }),
      });

      if (!response.ok) {
        throw new Error('Network response was not ok');
      }

      fetchAssignedPathologies(); // Refresh assigned pathologies after unassignment
      onAssign();
    } catch (error) {
      console.error('Error unassigning pathology:', error);
    }
  };

  const handleChange = (event) => {
    setSelectedPathologies(event.target.value);
  };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Assegna Patologie a {patient.nominativo}</DialogTitle>
      <DialogContent>
        <Typography>Seleziona una o più patologie da assegnare a questo paziente.</Typography>
        <FormControl fullWidth margin="normal">
          <InputLabel>Patologie</InputLabel>
          <Select
            multiple
            value={selectedPathologies}
            onChange={handleChange}
            renderValue={(selected) => selected.map(id => {
              const pathology = pathologies.find(p => p.id === id);
              return pathology ? pathology.name : '';
            }).join(', ')}
          >
            {pathologies.map((pathology) => (
              <MenuItem key={pathology.id} value={pathology.id}>
                <Checkbox checked={selectedPathologies.indexOf(pathology.id) > -1} />
                <ListItemText primary={pathology.name} />
              </MenuItem>
            ))}
          </Select>
        </FormControl>
        <Typography variant="h6" gutterBottom>Patologie Assegnate</Typography>
        {assignedPathologies.map((pathology) => (
          <div key={pathology.id}>
            <Typography>{pathology.name}</Typography>
            <Button onClick={() => handleUnassign(pathology.id)} color="secondary">Rimuovi</Button>
          </div>
        ))}
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">Annulla</Button>
        <Button onClick={handleAssign} color="primary">Conferma</Button>
      </DialogActions>
    </Dialog>
  );
};

export default AssignPathologiesDialog;
